import Link from 'next/link';

const QuestionList = (props) => (
	<div>
		{
		props.list.map(item => (
			<div>
				<Link href='{`${item.url}`}'>
					{ item.question }
				</Link>
			</div>
			))		
		}
	</div>
);

export default QuestionList;
